// SPDX-License-Identifier: MIT

pragma solidity ^0.8.3;

// import "./Ownable.sol";

contract SharedWallet {

    address public owner;
    uint public funds;
    uint public allowance = 1 ether;

    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner(){
        require(msg.sender == owner);
        _;
    }

    function depositFunds(uint _amount) public {
        funds += _amount;
    }

    function withdrawFunds(uint _amount) public {
        require(_amount <= allowance);
        funds -= _amount;

    }

    function ownerWithdrawFunds(address payable _to, uint _amount) public onlyOwner {
        assert(funds - _amount <= funds);
        funds -= _amount;
        _to.transfer(_amount);
    }

    receive() external payable {
        depositFunds(msg.value);
    }
}

